    "2016-07-15T04:24:06.455551",nt"name": "chronic-conditions-dashboard-e2c77",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The CMS Chronic Conditions Dashboard
    presents statistical views of information on the prevalence, utilization and Medicare
    spending for Medicare beneficiaries with chronic conditions. The information is
    available at the state and national levels and allows for comparisons of states
    to the national average as well as state to state comparisons. The Dashboard also
    allows the user to select information for specific beneficiary sub-groups defined
    by gender, age group, or dual eligibility status. The set of chronic conditions
    used in the Dashboard is consistent with the list of conditions included in the
    2012 edition of the CMS chartbook, Chronic Conditions among Medicare Beneficiaries.
     The data for this Dashboard come from the 2011 CMS administrative claims data
    for 100 percent of Medicare beneficiaries enrolled in the fee-for-service program.</p>n",nt"license_title":
